selector_to_html = {"a[href=\"#eigenschaften-und-varianten-des-k-nachste-nachbarn-algorithmus\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">21.6. </span>Eigenschaften und Varianten des k-N\u00e4chste-Nachbarn-Algorithmus<a class=\"headerlink\" href=\"#eigenschaften-und-varianten-des-k-nachste-nachbarn-algorithmus\" title=\"Link to this heading\">#</a></h1><h2><span class=\"section-number\">21.6.1. </span>Aufgabe: Immobilien klassifizieren<a class=\"headerlink\" href=\"#aufgabe-immobilien-klassifizieren\" title=\"Link to this heading\">#</a></h2><h3><span class=\"section-number\">21.6.1.1. </span>Daten und Visualisierung<a class=\"headerlink\" href=\"#daten-und-visualisierung\" title=\"Link to this heading\">#</a></h3><p>In den Trainingsdaten einer Immobiliengesellschaft sind pro Immobilie die folgenden <a class=\"reference internal\" href=\"#merkmal\"><span class=\"xref myst\">Merkmale</span></a> gespeichert:</p>", "a[href=\"#normalisierung-von-daten\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">21.7. </span>Normalisierung von Daten<a class=\"headerlink\" href=\"#normalisierung-von-daten\" title=\"Link to this heading\">#</a></h1><p>Bei der Anwendung des k-n\u00e4chsten-Nachbarn-Algorithmus kann es vorkommen, dass einige Merkmale (Features) einen gr\u00f6\u00dferen Einfluss auf die Berechnung der Distanzen haben als andere. Dies liegt daran, dass die Wertebereiche der Merkmale unterschiedlich sein k\u00f6nnen. Um dies zu verhindern, sollten die Daten normalisiert werden.</p><p>Die Normalisierung ist ein Verfahren, bei dem die Werte der Merkmale in einen gemeinsamen Bereich transformiert werden. Eine g\u00e4ngige Methode ist die Min-Max-Normalisierung, bei der die Werte eines Merkmals so skaliert werden, dass sie in einem Bereich von 0 bis 1 liegen.</p>", "a[href=\"#aufgabe-immobilien-klassifizieren\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">21.6.1. </span>Aufgabe: Immobilien klassifizieren<a class=\"headerlink\" href=\"#aufgabe-immobilien-klassifizieren\" title=\"Link to this heading\">#</a></h2><h3><span class=\"section-number\">21.6.1.1. </span>Daten und Visualisierung<a class=\"headerlink\" href=\"#daten-und-visualisierung\" title=\"Link to this heading\">#</a></h3><p>In den Trainingsdaten einer Immobiliengesellschaft sind pro Immobilie die folgenden <a class=\"reference internal\" href=\"#merkmal\"><span class=\"xref myst\">Merkmale</span></a> gespeichert:</p>", "a[href=\"#aufgabenstellung\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">21.6.1.2. </span>Aufgabenstellung<a class=\"headerlink\" href=\"#aufgabenstellung\" title=\"Link to this heading\">#</a></h3>", "a[href=\"#umsetzung-in-python\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">21.6.2. </span>Umsetzung in Python<a class=\"headerlink\" href=\"#umsetzung-in-python\" title=\"Link to this heading\">#</a></h2><p>In der folgenden Zelle wird eine neue Version des k-n\u00e4chsten-Nachbarn-Algorithmus implementiert.\nSie folgt unserer bisherigen Implementierung, ist aber etwas allgemeiner gehalten, insb.\nkann sie jetzt mit beliebig vielen Merkmalen umgehen.</p><p>Damit es nicht zu un\u00fcbersichtlich wird, sind die Funktionen eingeklappt. Nat\u00fcrlich darfst du sie\naber aufklappen und genau studieren. \ud83d\ude09</p>", "a[href=\"#daten-und-visualisierung\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\"><span class=\"section-number\">21.6.1.1. </span>Daten und Visualisierung<a class=\"headerlink\" href=\"#daten-und-visualisierung\" title=\"Link to this heading\">#</a></h3><p>In den Trainingsdaten einer Immobiliengesellschaft sind pro Immobilie die folgenden <a class=\"reference internal\" href=\"#merkmal\"><span class=\"xref myst\">Merkmale</span></a> gespeichert:</p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }
            link.classList.add('has-tippy');
            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: false,
                placement: 'auto-start', maxWidth: 500, interactive: true, boundary: document.body, appendTo: document.body,
                onShow(instance) {MathJax.typesetPromise([instance.popper]).then(() => {var isFirefox=typeof InstallTrigger!=='undefined';if(isFirefox&&window.MathJax&&MathJax.startup&&MathJax.startup.output&&MathJax.startup.output.name==="SVG"){const svgs=instance.popper.querySelectorAll('svg');svgs.forEach(svg=>{let bbox=svg.getBBox(),x=bbox.x,y=bbox.y,width=bbox.width,height=bbox.height;svg.setAttribute('width',width);svg.setAttribute('height',height);svg.setAttribute('viewBox',`${x} ${y} ${width} ${height}`);});let rescale=0.015;svgs.forEach(svg=>{let bbox=svg.getBBox(),width=bbox.width,height=bbox.height;svg.setAttribute('width',width*rescale);svg.setAttribute('height',height*rescale);});}});},
            });
        };
    };
    console.log("tippy tips loaded!");
};
